PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "active_storage_blobs" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "filename" varchar NOT NULL, "content_type" varchar, "metadata" text, "service_name" varchar NOT NULL, "byte_size" bigint NOT NULL, "checksum" varchar, "created_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "addresses" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "city" varchar, "house_no" varchar, "street" varchar, "landmark" varchar, "state" varchar, "pin" varchar, "country" varchar, "user_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "carts" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "user_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "items" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "quantity" bigint, "cart_id" integer, "product_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "shipments" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "status" integer, "expected_delivery" datetime(6), "order_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "tracking_orders" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "place" varchar, "status" integer, "shipment_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "active_storage_attachments" ("id" integer NOT NULL PRIMARY KEY, "name" varchar NOT NULL, "record_type" varchar NOT NULL, "record_id" integer NOT NULL, "blob_id" integer NOT NULL, "created_at" datetime(6) NOT NULL, CONSTRAINT "fk_rails_c3b3935057"
FOREIGN KEY ("blob_id")
  REFERENCES "active_storage_blobs" ("id")
);
CREATE TABLE IF NOT EXISTS "active_storage_variant_records" ("id" integer NOT NULL PRIMARY KEY, "blob_id" integer NOT NULL, "variation_digest" varchar NOT NULL, CONSTRAINT "fk_rails_993965df05"
FOREIGN KEY ("blob_id")
  REFERENCES "active_storage_blobs" ("id")
);
CREATE TABLE IF NOT EXISTS "active_admin_comments" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "namespace" varchar, "body" text, "resource_type" varchar, "resource_id" integer, "author_type" varchar, "author_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "offer_types_products" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "product_id" integer, "offer_type_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "bank_accounts" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "account_no" varchar, "ifsc_code" varchar, "bank" varchar, "branch_name" varchar, "city" varchar, "user_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "offer_types" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "discount_percent" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "discounts" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "discount_amount" integer, "product_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "notifications" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "action" varchar, "notificable_type" varchar, "notificable_id" integer, "user_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "otps" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "onetp" integer, "user_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "orders" ("id" integer NOT NULL PRIMARY KEY, "description" text DEFAULT NULL, "payment_method" integer DEFAULT NULL, "status" integer DEFAULT NULL, "track_id" varchar DEFAULT NULL, "user_id" integer DEFAULT NULL, "address_id" integer DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "orders_products" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "product_id" integer, "order_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "terms_and_conditions" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "terms" text, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "users" ("id" integer NOT NULL PRIMARY KEY, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "name" varchar DEFAULT NULL, "phone_number" varchar DEFAULT NULL, "role" integer DEFAULT NULL, "reset_password_token" varchar DEFAULT NULL, "reset_password_sent_at" datetime(6) DEFAULT NULL, "remember_created_at" datetime(6) DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "fssi_no" varchar DEFAULT NULL, "notification_status" boolean DEFAULT NULL, "stripe_id" varchar);
CREATE TABLE IF NOT EXISTS "transactions" ("id" integer NOT NULL PRIMARY KEY, "admin_commision" decimal DEFAULT NULL, "seller_earning" decimal DEFAULT NULL, "tax" decimal DEFAULT NULL, "total_amount" decimal DEFAULT NULL, "user_id" integer DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "order_id" integer DEFAULT NULL, "quantity" integer DEFAULT NULL, "product" varchar, "status" integer);
CREATE TABLE IF NOT EXISTS "order_items" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "quantity" integer, "product_id" integer, "order_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "payments" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "payment_id" varchar, "order_id" integer, "status" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "categories" ("id" integer NOT NULL PRIMARY KEY, "categories_type" varchar DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "sub_categories" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "category_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "variants" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "category_comission" decimal, "variant_name" varchar, "sub_category_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "properties" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "color" varchar, "size" varchar, "variant_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "products" ("id" integer NOT NULL PRIMARY KEY, "product_name" varchar DEFAULT NULL, "stock" integer DEFAULT NULL, "price" decimal DEFAULT NULL, "description" varchar DEFAULT NULL, "user_id" integer DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "category_id" integer DEFAULT NULL, "product_type" integer DEFAULT NULL, "discount_price" decimal DEFAULT NULL, "price_id" varchar DEFAULT NULL, "sub_category_id" integer DEFAULT NULL, "variant_id" integer DEFAULT NULL, CONSTRAINT "fk_rails_fb915499a4"
FOREIGN KEY ("category_id")
  REFERENCES "categories" ("id")
, CONSTRAINT "fk_rails_db9640ef46"
FOREIGN KEY ("sub_category_id")
  REFERENCES "sub_categories" ("id")
, CONSTRAINT "fk_rails_4ea5b8b05e"
FOREIGN KEY ("variant_id")
  REFERENCES "variants" ("id")
);
CREATE TABLE IF NOT EXISTS "product_sizes" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "variant_id" integer, "size" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "product_colors" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "product_id" integer, "color" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "sizes" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "product_id" integer, "product_size_id" integer, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
DELETE FROM sqlite_sequence;
